          "message": "Add Early Value Propagation phase (#613)\n\n* Model a Statement as a root StackEntry and a list of all the StackEntry in the tree.\n\n* Fix bug due to stack elements being structs\n\n* Refactor basic block statements\nFix number of bugs/missing functionality in SSA\n\n* Add Early value propagation phase\nFix CastCode to handle when source/destination types are the same and emit no code for this\n\n* Fix SQ issues\n\n* Add ReplaceWith method to StackEntry\nRefactor EarlyValuePropatation to use StackEntry.ReplaceWith\n\n* Add simple test for early value propagation of constant array size to ldlen\n\n* Fix SQ issues\n\n* Add test using array Length with loop when array has constant size and is declared in same menthod.\n\nWithout early value propagation optimisation the test takes 40482 T-states whilst with the optimization it reduces to 38961 T-states",
