          "message": "Xunit like asserts (#626)\n\n* Factor our Xunit asserts into separate library to be used across the tests\n\n* Replace Assert.cs with project reference to Tests.Common\nUse more Xunit like syntax for asserts\n\n* Add extra String.,Concat method with 3 parameters. Roslyn now tries to optimise interpolated string handling to pick Concat with appropriate number of strings or use params. Will revisit this in separate PR but adding Concat with 3 params supports change in Assert.HandleFail method\n\n* Use interpolated string for failed assert exception message\n\n* Use common XUnit like test project for Assert class.\n\n* Remove old Assert class\n\n* Add Assert.Equal overrides for specific types.\n\n* Use intrinsics in Assert.Equal<T>(..) to avoid need for explicit overrides for specific struct types.\nFix Equals on RuntimeTypeHandle by having the class implement IEquatable properly.\n\n* Add missing methods to RuntimeTypeHandle",
