          "message": "Return buffers inlining (#643)\n\n* Fix bugs in copying small to/fram stack when ixoffset is > 127 or < -128\n\n* Add extra cast conversion from short to ptr. This is to support conv.u opcode when stack contains a short.\n\n* Bug fixes in importers due to inlining having separate tables for parameters and locals\nMissed some places that need to use InlineInfo instead of normal local var table\nWhen creating RetuirnExpression nodes carry across return type size info\n\n* Still need to cater for returnbufferarg then ldarg during inlining\n\n* When inlining method using return buffer then import of return has to import store to return buffer and then set the substexpr as the return buffer itself.\n\n* Remove PutArg when inlining\n\n* Add more tests for inlining\n\n* Add missing locals in il\n\n* Fix SQ issue",
