          "id": "175b050dcbc28dda96edefe1599076124ab657d6",
          "message": "Improve argument use when inlining (#644)\n\n* Improve inliner with respect to arguments:\n* Args that are invariant and can't be modified e.g. constants, can be used directly in inlined method\n* Args that are local variables that can't be modified can be used with spilling to new temp\n\nFactor mapping of local variable number when parsing IL to take into account return buffer into single method in Importer\n\nFix bug with starg not taking return buffer into account.\n\nInvoke code folding from inliner - but note folder is not very capable currently and so won't have much effect.\n\n* Helper method to determine if a IR tree is invariant\nExtend importer interface to cover il number mapping for local variables\nExtend MethodDesc to get static constructor for owning type of method if one exists\n\n* Add test for inliner to cover inlined method with owning type having static constructor. Inlined method should ensure static constructor is run.\n\n* Fix bug with getting Static Constructor\n\n* Call to cctor should be at start of inlined statements",
