          "id": "edda9a6a2e6e7ffb249030412e58bc47364b730b",
          "message": "Inlining arg refactoring (#646)\n\n* Refactor inlining to not inline return buffer in the InlineArgumentInfos. Note that if the result of a call is not really consumed e..g thrown away by a pop then the return buffer is not actually added to the call thus we have to ignore return buffer args in the InlineArgumentInfos.\n\nAlso run code folding on the tree that has had something inlined into it.\n\n* Improve code folding which is now more important due to inlining.\n\nAdd some simple optimisations for binary operators where one of the operands ia  constant e.g. *1, /1, +0, -0.\n\n* Improve optimisations in binary op importing. Insert native int casts prior to code folding and simple *1, /1, +0, -0 optimisations\n\n* Pop importer doesn't need to introduce return buffer - so normal store local is sufficient\n\n* Fix code folding for subtraction - if one of operands is 0 then depends on if this is the left or right operand on the result. If it's the right operand then the subtraction is a no-op, if it's the left operand then the subtraction is effectively a negation.",
