          "message": "Inline multiple blocks (#647)\n\n* Extend inlining to inline methods with more than one block.\nMethods with multiple returns are excluded from inlining.\nInlining of methods with multiple blocks into a method with exception handlers are excluded from inlining.\nFixed Basic Block analyser to correctly detemine jump kinds and end offsets.\nFix typo with ReturnExpressionEntry SubstitutionExpression\nAlter branch importer to effectively ignore unconditional branches - the code generator will add jumps based on block successor.\n\n* Add inlining test to cover inlining of methods with multiple blocks\n\n* Fix SQ issues\n\n* Fix build failure",
