          "id": "20fc5321570a87759c45f502023ac15fb18c01e7",
          "message": "Fix stack unwinding (#659)\n\n* Store number of bytes required on stack for parameters.\nStop emitting same info prior to method code itself.\n\n* Remove unnecessary append of JumpEntry in IL.\nCodegen for basic blocks will emit the jump.\n\n* Revert \"Remove unnecessary append of JumpEntry in IL.\"\n\nThis reverts commit 003c16fe8c24acc3bafa64d1d33024dd5a0aa901.\n\n* Remove unnecessary append of jump entry as basic block codegen will emit the jump anyway\n\n* Emit unwind table storing number of parameter bytes for each code region corresponding to a method.\nUpdate SFINext to use the unwind table rather than look prior to the method being called as this didn't work for virtual/interface methods.\n\n* Mark Peek/Push/Pop as virtual now that exceptions support unwinding virtual methods properly.\n\n* Add extra exception tests to validate unwinding of virtual and interface methods",
