          "message": "Divide by zero exception (#689)\n\n* Add exception class\n\n* Add managed helper to throw DivideByZeroException\nIf any divide/remainder binary operators used then add new helper as a dependency\n\n* Update assembly code for division/remainder to tail call to managed helper to raise DivideByZeroException\n\n* Remove hardcoding of ThrowException when deciding if a method is trimmable and don't trim any method that has RuntimeExport attribute\nInclude RuntimeExport methods in unwind table but use non mangled name for them\n\n* Fix typo\n\n* Fix importer to spill catch argument to temp local to ensure correct evaluation order\n\n* Fix SSA bug highlighted by divide by zero il bvt tests\n\n* Uncomment tests for divide by zero",
