          "id": "ea8111d592c36ce0d13bfc7ab59ba5443b773e6b",
          "message": "Inliner improvements (#697)\n\n* Fix typo\n\n* Add IsNoInlining to managed typesystem\nAdd missing override for IsInternalCall to MethodForInstantiatedType\nWire up IsNoInlining to  dnlib\n\n* Add ILCodeSize to managed type system\nWire up to dnlib to get actual il code size\n\n* Refactor Inliner.cs into separate files in Inlining folder\nAdd heuristics support via InlineObservations and InlinePolicy\n\n* Can use Array.Clear in Chess sample now\n\n* Need to mark WaitForKeyPress in Mines as not inlineable. Will investigate this later on - without this no key presses are registered.\n\n* Add test for inlining method with multiple basic blocks into call at the very end of a basic block. This covers problem fixed in SplitBlockAfterStatement\n\n* Add missing init on Main locals. This is required as inliner doesn't yet init inlined locals if the callee is not initing its locals.\n\n* Handle recursion properly in inlining\n\n* Don't inline array methods as IL Code Size not currently calculated for the IL emitted by ArrayMethodILEmitter.\n\n* For now only inline methods explicitly marked with AggressiveInlining. Doing this as the inliner otherwise is a bit too aggressive and resulting in too much code bloat.\n\n* Add observation for when method is not marked as aggressive inlining\n\n* Fix SQ issue",
