          "message": "First working Iv strength reduction (#714)\n\n* Minor fixes for Ptr/Ref add/sub\n\n* Allow setting of Op1 for LocalVariable nodes which is useful in optimisations\n\n* Get the use as well as the parent\n\n* Fix bug with lowering shifts when ops are not int32\n\n* Support ptr/ref sized ints as well as int32\n\n* Extend unary operators to include narrowing\nImplement Simplify for unaryops\n\n* Extend SCEV analysis to support nativeints, casting, and ignore vars not in ssa which might have been introduced by the strength reduction process itself.\n\n* Helper to visit exit blocks of loop\n\n* Dump trees after strength reduction\n\n* Implement replacement of uses with new primary IVs\nBug fixes\n\n* Fix SQ issues",
